class IHsCommMessage():
    def __init__ (self, int_ptr):
        self.__int_ptr = int_ptr

    def GetItem(self, field_tag):
        return IHsItem(dagscom.GetItem(self.__int_ptr, field_tag))

    def GetBizResultSet(self, field_tag):
        return IHsBizset(dagscom.GetBizResultSet(self.__int_ptr, field_tag))

    def IsExist(self, field_tag):
        return dagscom.IsExist(self.__int_ptr, field_tag)

    def RemoveTag(self, field_tag):
        return dagscom.RemoveTag(self.__int_ptr, field_tag)

    def SetGroup(self, field_tag):
        return IHsGroup(dagscom.SetGroup(self.__int_ptr, field_tag))

    def GetGroup(self, field_tag):
        return IHsGroup(dagscom.GetGroup(self.__int_ptr, field_tag))

    def GetHead(self):
        return IHsRecord(dagscom.GetHead(self.__int_ptr))

    def GetBody(self):
        return IHsRecord(dagscom.GetBody(self.__int_ptr))

    def GetFunction(self):
        return dagscom.GetFunction(self.__int_ptr)

    def GetPacketType(self):
        return dagscom.GetPacketType(self.__int_ptr)

    def GetBizID(self):
        return dagscom.GetBizID(self.__int_ptr)

    def SetFunction(self, func_id):
        return dagscom.SetFunction(self.__int_ptr, func_id)

    def SetPacketType(self, pk_type):
        return dagscom.SetPacketType(self.__int_ptr, pk_type)

    def SetBizID(self, biz_id):
        return dagscom.SetBizID(self.__int_ptr, biz_id)

    def GetLastErrInfo(self):
        return dagscom.GetLastErrInfo(self.__int_ptr)

    def Clear(self):
        return dagscom.Clear(self.__int_ptr)

